import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import Row from 'react-bootstrap/Row';

const LandingPage = () => {
  return (
    <div className="Landing-container">
      <h1 className="introduction">Hello There</h1>
      <Container>
      <Row>
        <Col xs={6} md={4}>
          <Image src="https://pixabay.com/link/?ua=cd3%3Dimage%26cd7%3Den%253Adog%253A%26ec%3Dapi_ad%26ea%3Dnavigate%26el%3Dgetty%26tid%3DUA-20223345-1%26dr%3Dhttps%253A%252F%252Fpixabay.com%252Fimages%252Fsearch%252Fdog%252520yawning%252F&sp=%2524%3Dadvertisement_clicked%26media_type%3Dimage%26user_action%3Dnavigate%26ad_partner%3Dgetty%26ad_content%3Dapi_ad&next=https%3A%2F%2Fwww.istockphoto.com%2Fphoto%2Fadorable-one-year-old-cockapoo-gm1402117306-455130932%3Futm_source%3Dpixabay%26utm_medium%3Daffiliate%26utm_campaign%3DSRP_image_sponsored%26utm_content%3Dhttps%253A%252F%252Fpixabay.com%252Fimages%252Fsearch%252Fdog%252F%26utm_term%3Ddog&hash=d6d6cd8c3685ddb0dd6b9e3684acfe1a1c1d832e&=" rounded height="200px" width="500px"/>
        </Col>
      </Row>
    </Container>
    </div>
  )
}

export default LandingPage;
